import React from 'react';
import Header from '../components/Header';
import '../styles/research.css';



class Research extends React.Component{
    render() {
        return (
          <div>
          <Header />
          <div>
            <img className="fotoPessoal" alt="Funed" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t1.6435-9/91402586_3919548094722798_4320823188100481024_n.jpg?_nc_cat=109&ccb=1-5&_nc_sid=84a396&_nc_eui2=AeExN0-6Xo0gVII5wyXXiS6X-dH0qDgiHbb50fSoOCIdtkggdS2nDyKQImXm5zjBacHK8lPTJgUg3b1hq4PPapno&_nc_ohc=FoOeuiNoy2sAX_wQ05k&_nc_ht=scontent.fldb1-1.fna&oh=00_AT9MnPz8ToaCxiMsEsyk117YAiWREPnGEkHV2R-SGiiUag&oe=62447BB5"></img>
            <img className="fotoPessoal" alt="Funed Logo" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXNFKSIiBxTKJX6MOek6ZQa_-867rU_qVd5R9jZcGuiiqe7-EsD44gVdS1UtrLG91ICDY&usqp=CAU"></img>
            <img className="fotoPessoal" alt="Funed Cultivo garrafas" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/275124983_7386329894711250_7190798134605868815_n.jpg?_nc_cat=110&ccb=1-5&_nc_sid=730e14&_nc_eui2=AeFiqJeExSf5EDwYzai6OBSBHoUFRZylxoEehQVFnKXGgZPIGv_nmH7JLKsOzCO6XaYD40t4DV7vgKYF_5OwaGDv&_nc_ohc=GDcNnU_yYggAX-xhc_D&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-IpO5LCb4yJTs9fOAp6fWpzno1PGGDhHnNDYCnf75B4w&oe=62254560"></img>

            <img className="fotoPessoal" alt="Banca" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t1.6435-9/47396769_2580014035342884_3297034024186281984_n.jpg?_nc_cat=109&ccb=1-5&_nc_sid=84a396&_nc_eui2=AeE1LBjnP27plvSgm2RWrHmCFNVyPZypZ7gU1XI9nKlnuBq3SjY-XC8an-b5J9wNEbUTeKG9n54BnK9GTp34DAcM&_nc_ohc=2n-mCk2V91MAX-wNraR&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-cjPg3Wv4ykY14AmRnOUYN36X6_vdoZ3LzBcIn_MzN5A&oe=624402F2"></img>
            <img className="fotoPessoal" alt="Cefet Logo" src="data:image/png;base64,"></img>

            <img className="fotoPessoal" alt="Fundição" src="https://scontent.fldb1-1.fna.fbcdn.net/v/t1.18169-9/16427216_1781511421875247_8859807831468439221_n.jpg?_nc_cat=102&ccb=1-5&_nc_sid=a9b1d2&_nc_eui2=AeENM-O10zTHe7GrR3rtOMYjSw5hRBwUZ01LDmFEHBRnTW6BqeVjntl7qB2vcD0NxKIgAxzAP_WG41wfqgtB62oY&_nc_ohc=c-A2mtfsxGwAX833KRF&tn=yo4mCv-6Cay_Gace&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-TBSNPG7EvKY0wmIKJWigO5ie2AVgqlOBMD4b7p7Xgqg&oe=6243372F"></img>


          </div>
          </div>
        )
    }
}

export default Research;
